column5:
Enable Typescript to understand JSX default props

See https://github.com/Microsoft/TypeScript/pull/24422

This addition allows a Component to use defaultProps without having to
declare them as optional, in a nutshell:

Before

class Before extends Component<{ prop?: string }> {
	static defaultProps = {
		prop: "default value"
	};

	render() {
		// this.props.prop is string|undefined
	}
}

const element = <Before />;

After

class After extends Component<{ prop: string }> {
	static defaultProps = {
		prop: "default value"
	};

	render() {
		// typeof this.props.prop is string
	}
}

const element = <After />;

The definition isn't perfect, it doesn't quite understand type unions where
the type of a single property changes, e.g.

{ type: "number"; value: number } | { type: "string"; value: string }

But this case doesn't break, it just would require you to still provide
a property.

There might be some more things we can do with LibraryManagedAttributes,
it could allow the children property to be correct within Components
(always an Array) whilst still allowing components to specify the type
of children they accept.

Fix TypeScript type checking of setState with function argument.

Fixes #1284.

See https://github.com/DefinitelyTyped/DefinitelyTyped/blob/e836acc75a78cf0655b5dfdbe81d69fdd4d8a252/types/react/index.d.ts#L402
and https://github.com/DefinitelyTyped/DefinitelyTyped/issues/18365#issuecomment-351013257
for why this change is required.

Before:

    $ cat a.tsx
    import { Component } from './src/preact';

    class A extends Component<{}, { a: number }> {
      a() {
        this.setState(() => ({ a: 'a' }));
      }

      render() {
        return null;
      }
    }

    $ tsc --noEmit a.tsx && echo ok
    ok

After:

    $ tsc --noEmit a.tsx
    a.tsx:5:19 -     error TS2345: Argument of type '() => { a: string; }' is not assignable to parameter of type '{ a: number; } | Pick<{ a: number; }, "a"> | ((prevState: Readonly<{ a: number; }>, props: Readonly<{}>) => { a: number; } | Pick<{ a: number; }, "a">)'.
      Type '() => { a: string; }' is not assignable to type '(prevState: Readonly<{ a: number; }>, props: Readonly<{}>) => { a: number; } | Pick<{ a: number; }, "a">'.
        Type '{ a: string; }' is not assignable to type '{ a: number; } | Pick<{ a: number; }, "a">'.
          Type '{ a: string; }' is not assignable to type 'Pick<{ a: number; }, "a">'.
            Types of property 'a' are incompatible.
              Type 'string' is not assignable to type 'number'.

    5     this.setState(() => ({ a: 'a' }));

